def test_filter_donor_units_no_matching_units():
    data = {"UNITS": ["A", "A", "B", "B", "C", "C", "C"], "TIME": [1, 2, 1, 2, 1, 2, 3], "VAR": [10, 20, 10, 20, 10, 20, 30]}
    df = pd.DataFrame(data)
    treatment_unit = "C"
    unit_col = "UNITS"

    filtered_df = sc.filter_donor_units(df, treatment_unit, unit_col)

    expected_units = ["C"]
